import React from 'react'

class MainButtoms extends React.Component{
    render(){
        return(
            <div className = "group">
                <div className='btn1' onClick={Btn1Click}>
                    <h1>Create</h1>
                    <img src={require('./images/arrow.png')} id = "butImg"></img>
                </div>
                <div className='btn1' onClick={Btn2Click}>
                    <h1>Read</h1>
                    <img src={require('./images/arrow.png')} id = "butImg"></img>
                </div>
            </div>
        )
    }
    //Paste Login form
    Btn1Click = () => {
        console.log("go to create");
    }
    Btn2Click = () => {
        console.log("read list");
    }
}

export default MainButtoms
